import React from 'react';
import "../common/style/table.css";

// import './Table.css'; // Import your CSS file for styling

const Table = () => {
  const tableData = [
    ['01', 'www.google.com', 'QB0GaK7', 'Cell 4', 'Cell 5'],
    ['02', 'timesonline.co.uk', 'Z9I2', 'Cell 9', 'Cell 10'],
    ['03', 'newyorker.com', 'Cell 13', 'Cell 14', 'Cell 15'],
    ['04', 'angelfire.com', 'Cell 18', 'Cell 19', 'Cell 20'],
    ['05', 'state.gov', 'Cell 23', 'Cell 24', 'Cell 25'],
  ];

  return (
    // <div>
    //   <span style={{marginTop: "50px"}}>
    //     <h3>Upload</h3>
    //   </span>
    // </div>
    <table className="custom-table">
      <thead>
        <tr>
          <th>SL No</th>
          <th>Links</th>
          <th>Prefix</th>
          <th>Add Tags</th>
          <th>Selected Tags</th>
        </tr>
      </thead>
      <tbody>
        {tableData.map((row, rowIndex) => (
          <tr key={rowIndex}>
            {row.map((cell, cellIndex) => (
              <td key={cellIndex}>{cell}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Table;
